import React from 'react';

// Header 컴포넌트 정의
function Header() {
  const style = {
    backgroundColor: 'D4D2E3',
    color: 'black',
  };
  return (
    <header>
      <h1 style={style}>BALANCETALK</h1>
      <nav>
        <ul>
          <li><a href="/">홈</a></li>
          <li><a href="/about">소개</a></li>
          <li><a href="/contact">연락</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
